import React, {useEffect, useState} from "react";

function ProductList(){

    const [productData, setProductData] = useState([]);
    useEffect( ()=>{
        const getProductList = async()=>{
            const reqProduct = await fetch("http:///localhost:8000/api/product");
            const resProduct = await reqProduct.json();
            //console.log(resProduct);
            setProductData(resProduct);
        }
        getProductList();

    },[]);
    return(
        <React.Fragment>
            <div class="container">
                <h5>Lista de Produtos</h5>
                <table class="table">
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">Nome</th>
                            <th scope="col">Valor</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            productData.map((pData, index)=>(
                                <tr key={index}>
                                    <th>{index+1}</th>
                                    <td>{pData.nome}</td>
                                    <td>{pData.valor}</td>
                                </tr>
                            ))
                        }

                    </tbody>
                </table>

            </div>
        </React.Fragment>
    );
}

export default ProductList;
